webpackJsonp([24794943383322],{491:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Today I attended a series of talks related to Android at the <strong>Madrid</strong> edition of DroidCon 2013.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="t-shirt"\n        title=""\n        src="/static/droidcon_t-shirt-4f5a4f94c6e536c8372749bbf52ab6fe-7ee4f.png"\n        srcset="/static/droidcon_t-shirt-4f5a4f94c6e536c8372749bbf52ab6fe-785d5.png 148w,\n/static/droidcon_t-shirt-4f5a4f94c6e536c8372749bbf52ab6fe-2f066.png 295w,\n/static/droidcon_t-shirt-4f5a4f94c6e536c8372749bbf52ab6fe-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>This came about thanks to my University that organised the travel and tickets while giving <strong>50 people</strong> the chance to go at no cost.</p>\n<p>After the 5 hour bus ride, the morning started off with a talk centered on the new types of apps that <strong>Google Glass</strong> will allow, they called it a completely different device category with a whole new set of ideas for apps. I disagree, most of what they were working on were <strong>apps</strong> that already existed except with Glass now they’re easier to use because it leaves your hands free.</p>\n<p>A high point was that they had a prototype quadricopter drone that they are developing jointly with the red cross for surveying disaster struck areas.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="drone"\n        title=""\n        src="/static/droidcon-drone-9a63b6c0ee1e706afd528b3cf9af98e7-7ee4f.png"\n        srcset="/static/droidcon-drone-9a63b6c0ee1e706afd528b3cf9af98e7-785d5.png 148w,\n/static/droidcon-drone-9a63b6c0ee1e706afd528b3cf9af98e7-2f066.png 295w,\n/static/droidcon-drone-9a63b6c0ee1e706afd528b3cf9af98e7-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It includes a GoPro mounted on a gyroscope so no matter how erratic the flying may be the image stays steady making it easier to effectively survey the area.</p>\n<p>The second talk I attended was the one I was most looking forward to. It was on <strong>Volley</strong> which is a new framework announced at this years I/O and it provides simpler and faster data transfers. When Volley was announced at I/O I instantly wanted to use it in the app I was working on but it had little to no documentation. I was hoping this might have changed 7 months later but to my dismay, on the powerpoint slide listing the downsides to Volley, the only item was “No documentation”. </p>\n<p>The rest of the talks were pretty dissapointing, mostly companies pushing their products rather than inspiring us or providing us with new ideas. </p>\n<p>Another cool moment was that for some reason there was an <strong>Oculus Rift</strong> set up with a full cockpit and iRacing. The Oculus definitely does a great job at providing an immersive experience but I found the resolution incredibly low and made it quite hard to use.</p>\n<p>To end with, it was interesting to see that even in <strong>Spain</strong>, the majority of the developers present were coding on a Macbook, taking photos with their iPad and messaging on their iPhone. There was also a small group of diehard Blackberry users doing their best to convince the Android users to make the switch while still being able to develop for Android.</p>',frontmatter:{date:"December 10, 2013",path:"/droicon-mad.html",tags:["tag"],title:"Droidcon",image:{childImageSharp:{resize:{src:"/static/balloons-4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"Best Movies: 2013  was a tricky year for movies, I was starting to wonder if I could even make up a list as I couldn’t think of any blockbusters I’d want to watch again(Apart from White House Down but I’d lose all credibility if I put that on a “Best…",html:'<h3 id="best-movies"><a href="#best-movies" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><strong>Best Movies:</strong></h3>\n<p><strong>2013</strong> was a tricky year for movies, I was starting to wonder if I could even make up a list as I couldn’t think of any blockbusters I’d want to watch again(Apart from White House Down but I’d lose all credibility if I put that on a “Best of” list), thankfully good old <strong>indies</strong> came to the rescue.</p>\n<ul>\n<li>\n<p><strong>The Place Beyond The Pines</strong> </p>\n</li>\n<li>\n<p><strong>The Way Way Back</strong> </p>\n</li>\n<li>\n<p><strong>The Kings of Summer</strong> </p>\n</li>\n<li>\n<p><strong>Sound City</strong> </p>\n</li>\n</ul>\n<p>  <strong>Footnote:</strong><br>\nI feel like this list could easily change over the next couple of months as there are a lot of movies I’ve yet to see from 2013 such as “Dallas Buyers Club”, “The Counselor” and “The Wolf of Wall Street” all of which could easily end up topping my list. A similar thing happened for <strong>2012</strong> with “Django Unchained”.</p>\n<h3 id="best-music"><a href="#best-music" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><strong>Best Music:</strong></h3>\n<ul>\n<li>\n<p><strong>Chunk! No, Captain Chunk! - Pardon My French</strong></p>\n</li>\n<li>\n<p><strong>Paramore - Paramore</strong></p>\n</li>\n<li>\n<p><strong>A Day to Remember - Common Courtesy</strong></p>\n</li>\n<li>\n<p><strong><a href="%22http://blacknumbers.bandcamp.com/album/born-to-make-believe-part-1%22">The Here and Now - Born to Make Believe</a></strong>  </p>\n</li>\n</ul>\n<h3 id="video-games"><a href="#video-games" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><strong>Video Games:</strong></h3>\n<ul>\n<li>\n<p><strong>Outlast (pc)</strong><br>\nAs one redditor put it perfectly “Nope simulator 2013”. Never has a game put me so on edge, I found I had to play this game in 10 minute intervals as any more would start to seriously affect me with the unbearable tension it creates.</p>\n</li>\n<li>\n<p><strong>Grand theft Auto V (ps3)</strong><br>\nIf this had been a pc release it would have been at the top of my list but after finishing the main story I couldn’t bring myself to 100% it with the lacklustre graphics and loading times that entails a game of such scale being forced onto a console. Still an amazing game that doesn’t dissapoint, <strong>Rockstar</strong> definitely delivered with this next installment in the franchise.</p>\n</li>\n<li>\n<p><strong>Bioshock: Infinite (pc)</strong><br>\nIt isn’t often that as soon as I finish a game I proceed to start again from the beginnning almost immediately, great mechanics, great story, great graphics. <strong>10/10</strong>.</p>\n</li>\n<li>\n<p><strong>The Stanley Parable (pc)</strong><br>\nIt’s hard to put this in the main list when it’s such a short “game”\nbut it has come such a long way since the original <strong>Half Life</strong> mod that it should definitely be mentioned, also, the demo was genius and took meta to a whole new level.</p>\n</li>\n</ul>\n<h3 id="best-gadget"><a href="#best-gadget" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><strong>Best Gadget:</strong></h3>\n<ul>\n<li>There have been lots of shiny new devices(<strong>Macbooks, iPhones</strong>..), innovations(<strong>Pebble, Oculus Rift</strong>) but I feel like nothing has really delivered or wowed me yet so there’s nothing for me to write about here really.</li>\n</ul>\n<h3 id="fail-of-the-year"><a href="#fail-of-the-year" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><strong>Fail of the year:</strong></h3>\n<ul>\n<li>Apple from a software standpoint, for the first time I’m encountering buggy programs and unsolvable problems which is very disheartening and I hope they <strong>refocus</strong> and stop worrying about yearly OS releases and dedicate more time refining their great software offerings.</li>\n</ul>',id:"/home/circleci/repo/posts/2014-01-01-best-of-2013/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2014-01-01T12:00:00+00:00",path:"/best-of-2013.html",tags:["tag"],title:"Best of 2013"}},next:{excerpt:"Earlier this month,  Apple  unveiled their latest iPhone and one of the most interesting things from the keynote was the fact that they have now moved to a 64 bit CPU. It comes as no surprise that Apple were the first to make the switch seeing as 1…",html:'<p>Earlier this month, <strong>Apple</strong> unveiled their latest iPhone and one of the most interesting things from the keynote was the fact that they have now moved to a 64 bit CPU.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 85.625%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ARM 64"\n        title=""\n        src="/static/ARM64-6cee269e7df1add2ec563c375f4e9cb8-01035.png"\n        srcset="/static/ARM64-6cee269e7df1add2ec563c375f4e9cb8-11eff.png 148w,\n/static/ARM64-6cee269e7df1add2ec563c375f4e9cb8-b9d93.png 295w,\n/static/ARM64-6cee269e7df1add2ec563c375f4e9cb8-01035.png 480w"\n        sizes="(max-width: 480px) 100vw, 480px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It comes as no surprise that Apple were the first to make the switch seeing as 10 years ago at WWDC 2003 they uneveiled the first <strong>desktop</strong> computer with a 64 bit CPU.</p>\n<p>The surprise was when people were against this change and called it a gimmick, mostly centered on the <strong>short sighted</strong> thought that all a 64 bit CPU provides is more addressing space and thus allowing more than 4GB of RAM. Being able to have more than 4GB of RAM in a mobile device seemed silly when the iPhone <strong>still</strong> chugs along just fine with 1GB of RAM.</p>\n<p><strong>There really is a lot more to it than just a wider addressing space.</strong></p>\n<p><a href="%22https://twitter.com/mikeash%22">Mike Ash</a> has written a great <a href="%22http://www.mikeash.com/pyblog/friday-qa-2013-09-27-arm64-and-you.html%22">article</a>\nwith the basics of what 64 bit ARM actually brings to the table and rather than paraphrase anything from his excellent write up, I <strong>insist</strong> that you go read it, understand it and then be excited for how quickly we got here.</p>',id:"/home/circleci/repo/posts/2013-09-29-ARM64/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2013-09-29T12:00:00+00:00",path:"/arm64.html",tags:["tag"],title:"AArch64"}}}}}});
//# sourceMappingURL=path---droicon-mad-html-56333e792fa0fb41f5f5.js.map